INSERT INTO apps_applicationitem VALUES(452,'Kitobxonlik madaniyati','Saytda Kitobxonlik boʻyicha test topshirayotgan paytimda, bilmadim internet pant berdimi, uni oxirigacha yecha olmadim. Sayt birdan yopilib qoldi va qayta ishlash imkoni boʻlmadi.',NULL,'',42,14,NULL,NULL);
INSERT INTO apps_applicationitem VALUES(453,'5 muhim tashabbus doirasidagi to‘garaklarda faol ishtiroki','5 muhim tashabbus doirasida sport yoʻnalishi boʻyicha faol ishtirok etdim deb ayta olaman. Buning natijasida Universitetda oʻtkazilgan har bir musobaqada faol qatnashib, jamoamiz bilan faxrli oʻrinlarni egalladik.',NULL,'',42,15,NULL,NULL);
