INSERT INTO apps_applicationitem VALUES(456,'Xalqaro, Respublika, viloyat miqyosdagi ko‘rik-tanlov, fan olimpiadalari va sport musobaqalarida erishgan natijalari',replace('TDTU da boʻlib oʻtgan har bir olimpiada va tadbirlarda faol ishtirok etishga harakat qildim.\nShuning natijasida Informatika fanidan xalqaro olimpiadada faxrli 3-oʻrinni egalladim. Bundan tashqari “Tibbiyotdagi Zulfiyalar” toʻplamida oʻz she’rimni chop ettirishga muvaffaq boʻldim.','\n',char(10)),NULL,'',42,18,NULL,NULL);
INSERT INTO apps_applicationitem VALUES(457,'Talabaning darslarga to‘liq, kechikmasdan kelishi','',NULL,'',42,19,NULL,NULL);
INSERT INTO apps_applicationitem VALUES(458,'Talabalarning “Ma’rifat darsi”dagi faol ishtiroki','Ma’rifat darslariga doim qatnashib borganmiz. Asosan bu hol onlayn tarzda boʻlib qolar edi. Bu haqida tyutorimizga doim ma’lumot berib borganmiz. Quyida shu faylni taqdim etishga qaror qildim.',NULL,'',42,20,NULL,NULL);
INSERT INTO apps_applicationitem VALUES(459,'Volontyorlik va jamoat ishlaridagi faolligi','Fayl yuklashga ulgurmadim. Men fayllarni boʻlib-boʻlib yuklash imkoni bor deb oʻylab barcha fayllarni birdan yuklamagan edim. Bizda bu birinchi marta boʻlayotgani uchun adashishlarni kechirishadi yoki yana bir imkon berishadi degan umiddaman.',NULL,'',42,21,NULL,NULL);
INSERT INTO apps_applicationitem VALUES(460,'Teatr va muzey, xiyobon, kino, tarixiy qadamjolarga tashriflar','Bunday joylarda koʻp boʻlganmiz. Ustozlar bilan ham, kursdoshlar bilan ham. Quyida dalil sifatida ba’zi suratlarni keltirib oʻtdim',NULL,'',42,22,NULL,NULL);
INSERT INTO apps_applicationitem VALUES(461,'Talabaning sport bilan shug‘uHanishi va sog‘lom turmush tarziga amal qilishi','Sport bilan shugʻullanish jon-u dilim. Bolaligimdan sportga qiziqqanman va doim ishtirok etib kelganman. TDTU ga kelganimda ham birinchi qilgan ishim  voleybol jamoasiga qoʻshilganim boʻlgan. Chunki sport bilan shugʻullanish rivojlanishning asosiy tamoyillaridan biri deb bilaman.',NULL,'',42,23,NULL,NULL);
INSERT INTO apps_applicationitem VALUES(462,'Ma’naviy-ma’rifiy sohaga oid boshqa yo‘nalishlardagi faolligi uchun','Fayl yuklashga ulgurmadim. Men fayllarni boʻlib-boʻlib yuklash imkoni bor deb oʻylab barcha fayllarni birdan yuklamagan edim.Bizda bu birinchi marta boʻlayotgani uchun adashishlarimizni kechirishadi degan umiddaman.',NULL,'',42,24,NULL,NULL);
