INSERT INTO apps_question VALUES(1,'#Tohirni ota-onasi kimga unashtirishgan edilar?','',1);
INSERT INTO apps_question VALUES(2,'Tohir nega Robiyani qoʻrgʻonga borishga qoʻymaydi?','',1);
INSERT INTO apps_question VALUES(3,'Robiya tushida Tohirni qanday vahimali koʻradi?','',1);
INSERT INTO apps_question VALUES(4,'Tohirning Andijonda meʼmor boʻlib ishlaydigan togʻasining ismi nima boʻlgan?','',1);
INSERT INTO apps_question VALUES(5,'Ahmad Tanbal mulla Fazliddinga kimning rasmini chizishini aytadi?','',1);
INSERT INTO apps_question VALUES(6,'Mulla Fazliddin Ahmad Tanbaldan kimni suratini yashiradi va sandigʻida kimning surati boʻladi?','',1);
INSERT INTO apps_question VALUES(7,'Mulla Fazliddin kimga oshiq boʻladi?','',1);
INSERT INTO apps_question VALUES(8,'Tohirga yogʻoch koʻprikni yoqishda kim yordam beradi?','',1);
INSERT INTO apps_question VALUES(9,'Tohir nega Robiyaning akasi Mahmud bilan tunda koʻprikni yondirish uchun Quvaning koʻprigi yoniga keladi?','',1);
INSERT INTO apps_question VALUES(10,'Umarshayx Mirzoning birinchi xotini va ikkinchi xotinini ismi nima?','',1);
INSERT INTO apps_question VALUES(11,'Umarshayx Mirzoning farzandlari nechta va ular necha yoshda boʻlgan?','',1);
INSERT INTO apps_question VALUES(12,'Urush vaqtida Bobur Mirzo qayerda boʻlgan?','',1);
INSERT INTO apps_question VALUES(13,'Umarshayx Mirzo qayerda vafot etadi?','',1);
INSERT INTO apps_question VALUES(14,'Xonzoda begim va Mulla Fazliddin ark darvozasi tomon borganda yogʻiy qoʻlidan qochib ortlariga qaytishtimi?','',1);
