PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "apps_applicationtype" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "key" varchar(100) NOT NULL UNIQUE, "name" varchar(100) NOT NULL, "subtitle" varchar(255) NULL, "image" varchar(100) NULL, "min_gpa" real NULL, "access_type" varchar(20) NOT NULL);
CREATE TABLE IF NOT EXISTS "apps_level" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(10) NOT NULL UNIQUE, "name" varchar(50) NOT NULL);
CREATE TABLE IF NOT EXISTS "apps_applicationitem" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(255) NOT NULL, "student_comment" text NULL, "reviewer_comment" text NULL, "file" varchar(100) NULL, "application_id" bigint NOT NULL REFERENCES "apps_application" ("id") DEFERRABLE INITIALLY DEFERRED, "direction_id" bigint NOT NULL REFERENCES "apps_direction" ("id") DEFERRABLE INITIALLY DEFERRED, "gpa" real NULL, "test_result" real NULL);
CREATE TABLE IF NOT EXISTS "apps_customadminuser_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "customadminuser_id" bigint NOT NULL REFERENCES "apps_customadminuser" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "apps_customadminuser_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "customadminuser_id" bigint NOT NULL REFERENCES "apps_customadminuser" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "apps_customadminuser_directions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "customadminuser_id" bigint NOT NULL REFERENCES "apps_customadminuser" ("id") DEFERRABLE INITIALLY DEFERRED, "direction_id" bigint NOT NULL REFERENCES "apps_direction" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "apps_customadminuser_faculties" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "customadminuser_id" bigint NOT NULL REFERENCES "apps_customadminuser" ("id") DEFERRABLE INITIALLY DEFERRED, "faculty_id" bigint NOT NULL REFERENCES "apps_faculty" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "apps_customadminuser_levels" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "customadminuser_id" bigint NOT NULL REFERENCES "apps_customadminuser" ("id") DEFERRABLE INITIALLY DEFERRED, "level_id" bigint NOT NULL REFERENCES "apps_level" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "apps_customadminuser_sections" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "customadminuser_id" bigint NOT NULL REFERENCES "apps_customadminuser" ("id") DEFERRABLE INITIALLY DEFERRED, "section_id" bigint NOT NULL REFERENCES "apps_section" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "apps_historicalscore" ("id" bigint NOT NULL, "value" real NOT NULL, "note" text NOT NULL, "scored_at" datetime NOT NULL, "history_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "history_date" datetime NOT NULL, "history_change_reason" varchar(100) NULL, "history_type" varchar(1) NOT NULL, "history_user_id" bigint NULL REFERENCES "apps_customadminuser" ("id") DEFERRABLE INITIALLY DEFERRED, "item_id" bigint NULL, "reviewer_id" bigint NULL);
CREATE TABLE IF NOT EXISTS "apps_applicationtype_allowed_levels" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "applicationtype_id" bigint NOT NULL REFERENCES "apps_applicationtype" ("id") DEFERRABLE INITIALLY DEFERRED, "level_id" bigint NOT NULL REFERENCES "apps_level" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "apps_gparecord" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "education_year" varchar(20) NOT NULL, "level" varchar(50) NOT NULL, "gpa" varchar(10) NOT NULL, "credit_sum" real NOT NULL, "subjects" integer NOT NULL, "debt_subjects" integer NOT NULL, "can_transfer" bool NOT NULL, "method" varchar(50) NOT NULL, "created_at" datetime NOT NULL, "student_id" bigint NOT NULL REFERENCES "apps_student" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "apps_specialapplicationstudent" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "hemis_id" varchar(20) NOT NULL, "application_type_id" bigint NOT NULL REFERENCES "apps_applicationtype" ("id") DEFERRABLE INITIALLY DEFERRED, "student_id" bigint NULL REFERENCES "apps_student" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "apps_score" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "value" real NOT NULL, "note" text NOT NULL, "scored_at" datetime NOT NULL, "item_id" bigint NOT NULL UNIQUE REFERENCES "apps_applicationitem" ("id") DEFERRABLE INITIALLY DEFERRED, "reviewer_id" bigint NULL REFERENCES "apps_customadminuser" ("id") DEFERRABLE INITIALLY DEFERRED, CONSTRAINT "unique_score_per_application_item" UNIQUE ("item_id"));
CREATE TABLE IF NOT EXISTS "apps_section" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NULL);
CREATE TABLE IF NOT EXISTS "apps_question" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "text" text NOT NULL, "correct_option" varchar(1) NOT NULL, "test_id" bigint NOT NULL REFERENCES "apps_test" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "apps_testsession_questions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "testsession_id" bigint NOT NULL REFERENCES "apps_testsession" ("id") DEFERRABLE INITIALLY DEFERRED, "question_id" bigint NOT NULL REFERENCES "apps_question" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "apps_testsession" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "student_id" bigint NOT NULL REFERENCES "apps_student" ("id") DEFERRABLE INITIALLY DEFERRED, "test_id" bigint NOT NULL REFERENCES "apps_test" ("id") DEFERRABLE INITIALLY DEFERRED, "started_at" datetime NOT NULL, "correct_answers" integer NULL, "finished_at" datetime NULL, "total_questions" integer NULL, "score" real NULL);
CREATE TABLE IF NOT EXISTS "apps_test" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(255) NOT NULL, "question_count" integer NOT NULL, "time_limit" integer NOT NULL, "created_at" datetime NOT NULL, "start_time" datetime NULL);
CREATE TABLE IF NOT EXISTS "apps_test_levels" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "test_id" bigint NOT NULL REFERENCES "apps_test" ("id") DEFERRABLE INITIALLY DEFERRED, "level_id" bigint NOT NULL REFERENCES "apps_level" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "apps_option" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "label" varchar(1) NOT NULL, "text" text NOT NULL, "question_id" bigint NOT NULL REFERENCES "apps_question" ("id") DEFERRABLE INITIALLY DEFERRED, "is_correct" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "apps_answer" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "is_correct" bool NOT NULL, "question_id" bigint NOT NULL REFERENCES "apps_question" ("id") DEFERRABLE INITIALLY DEFERRED, "session_id" bigint NOT NULL REFERENCES "apps_testsession" ("id") DEFERRABLE INITIALLY DEFERRED, "selected_option_id" bigint NOT NULL REFERENCES "apps_option" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "apps_application" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "comment" text NULL, "status" varchar(10) NOT NULL, "submitted_at" datetime NOT NULL, "application_type_id" bigint NOT NULL REFERENCES "apps_applicationtype" ("id") DEFERRABLE INITIALLY DEFERRED, "section_id" bigint NOT NULL REFERENCES "apps_section" ("id") DEFERRABLE INITIALLY DEFERRED, "student_id" bigint NOT NULL REFERENCES "apps_student" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "apps_direction" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL, "require_file" bool NOT NULL, "min_score" real NOT NULL, "max_score" real NOT NULL, "section_id" bigint NOT NULL REFERENCES "apps_section" ("id") DEFERRABLE INITIALLY DEFERRED, "direction_type" varchar(10) NOT NULL, "test_id" bigint NULL REFERENCES "apps_test" ("id") DEFERRABLE INITIALLY DEFERRED, "type" varchar(10) NOT NULL);
CREATE TABLE IF NOT EXISTS "apps_odobaxloqstudent" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "sabab" varchar(500) NOT NULL, "hemis_id" varchar(20) NOT NULL);
CREATE TABLE IF NOT EXISTS "apps_applicationfile" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "comment" text NULL, "uploaded_at" datetime NOT NULL, "section_id" bigint NOT NULL REFERENCES "apps_section" ("id") DEFERRABLE INITIALLY DEFERRED, "item_id" bigint NOT NULL REFERENCES "apps_applicationitem" ("id") DEFERRABLE INITIALLY DEFERRED, "file" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "komissiya_komissiyamember" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "role" varchar(20) NOT NULL, "created_at" datetime NOT NULL, "course_id" bigint NULL REFERENCES "apps_level" ("id") DEFERRABLE INITIALLY DEFERRED, "direction_id" bigint NULL REFERENCES "apps_direction" ("id") DEFERRABLE INITIALLY DEFERRED, "faculty_id" bigint NULL REFERENCES "apps_faculty" ("id") DEFERRABLE INITIALLY DEFERRED, "section_id" bigint NULL REFERENCES "apps_section" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL UNIQUE REFERENCES "apps_customadminuser" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "apps_contractinfo" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "contract_number" varchar(100) NOT NULL, "contract_date" date NOT NULL, "edu_organization" varchar(255) NOT NULL, "edu_speciality" varchar(255) NOT NULL, "edu_period" integer NOT NULL, "edu_year" varchar(100) NOT NULL, "edu_type" varchar(100) NOT NULL, "edu_form" varchar(100) NOT NULL, "edu_course" varchar(50) NOT NULL, "contract_type" varchar(100) NOT NULL, "pdf_link" varchar(200) NOT NULL, "contract_sum" bigint NOT NULL, "debit" bigint NULL, "credit" bigint NULL, "student_id" bigint NOT NULL UNIQUE REFERENCES "apps_student" ("id") DEFERRABLE INITIALLY DEFERRED, "gpa" real NULL);
CREATE TABLE IF NOT EXISTS "apps_faculty" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL, "code" varchar(50) NOT NULL, "hemis_id" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "apps_customadminuser" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "authtoken_token" ("key" varchar(40) NOT NULL PRIMARY KEY, "created" datetime NOT NULL, "user_id" bigint NOT NULL UNIQUE REFERENCES "apps_customadminuser" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "apps_customadminuser" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "first_name" varchar(150) NOT NULL, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "role" varchar(20) NOT NULL, "can_score" bool NOT NULL, "limit_by_course" bool NOT NULL, "allow_all_students" bool NOT NULL, "university1_id" bigint NULL REFERENCES "apps_university" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "apps_student" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "student_id_number" varchar(20) NOT NULL UNIQUE, "full_name" varchar(255) NOT NULL, "short_name" varchar(100) NOT NULL, "email" varchar(254) NULL, "phone" varchar(20) NULL, "image" varchar(200) NULL, "gender" varchar(10) NOT NULL, "birth_date" date NULL, "address" text NULL, "university" varchar(255) NOT NULL, "group" varchar(100) NOT NULL, "faculty_id" bigint NULL REFERENCES "apps_faculty" ("id") DEFERRABLE INITIALLY DEFERRED, "level_id" bigint NULL REFERENCES "apps_level" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL UNIQUE REFERENCES "apps_customadminuser" ("id") DEFERRABLE INITIALLY DEFERRED, "university1_id" bigint NULL REFERENCES "apps_university" ("id") DEFERRABLE INITIALLY DEFERRED);
